import React from 'react';
import Header from "./Header";
import Footer from "./Footer";
import {Link} from "react-router-dom";


const Signup = () => {
    return (
        <div className="flex-grow">
            <div>
                <div>
                    <div>
                        <h1>The easiest way to invest</h1>
                        <p>Trade between multiple asset classes from one convenient account.
                            A large number of assets are now less than a minute away</p>
                    </div>
                    <div>
                        <img alt={"multiple cryptocurrency"}/>
                    </div>
                </div>
            </div>

            <div>
                <div>
                    <h3>Soyez les bienvenue parmi nous O.o</h3>
                    <p>
                        Deja membre chez nous ?
                        <Link to={"/"}>Login </Link>
                    </p>
                </div>

            </div>
        </div>
    );
};

export default Signup;
